import '../style/Home.scss'
import logo from '../assets/images/logo.png'
import { Button } from '../components/Button/index'
import { Link } from 'react-router-dom'
import { MainAside } from '../components/MainAside'
import { FormEvent, useState } from 'react'
import ReactDOM from 'react-dom';
import load from '../assets/gifs/load.gif'

export function Cadastro() {

    const [terms, setTerms] = useState(false)
    const [infoSign, setInfoSign] = useState({
        'nome': '',
        'sobrenome': '',
        'email': '',
        'senha': '',
        'senhaConfirma': '',
        'dataNascimento': ''
    })

    async function handleSignUp(event: FormEvent) {
        event.preventDefault();

        if(terms == false){
            const erroMessage = document.getElementById('erroMessage')
            erroMessage!.innerHTML = 'VocÃª precisa aceitar os termos para se cadastrar.'
            erroMessage!.style.display = 'block'
        }
        let formInfoSign = Object.entries(infoSign)
        const dataConfigs = new FormData();
        formInfoSign.map(data => {
            dataConfigs.append(data[0], data[1])
        })

        const configs = {
            header: {
                'Accept': 'application/json',
                'Content-Type': 'application/x-www-form-urlencoded'
            },
            method: 'POST',
            body: dataConfigs
        }
        const cadastroContent = document.getElementById('right-content')?.innerHTML

        ReactDOM.render(<img src={load} alt="Carregando" />, document.getElementById('right-content'))
        fetch('http://localhost:8000/cadastro', configs)
            .then(response => {
                return response.json()
            })
            .then(data => {
                
                if(data.status == false){
                    document.getElementById('right-content')!.innerHTML = cadastroContent!
                }else if(data.status == true){
                    document.getElementById('right-content')!.innerHTML = '<h1>Hello world! </h1>'
                }
                
                
                console.log(data.status)
            })
    }

    return (
        <div id="page-home">

            <MainAside />

            <main id="right-content">
                <img src={logo} alt="Logo frindly finance" />
                <h2>JÃ¡ possuÃ­ a sua conta? <Link to={'/'}>fazer login</Link></h2>
                <form onSubmit={handleSignUp}>
                    <input
                        type="text"
                        placeholder="Nome"
                        onChange={event => {
                            setInfoSign(prevState => {
                                return { ...prevState, 'nome': event.target.value }
                            })
                        }}
                        value={infoSign.nome}
                    />
                    <input
                        type="text"
                        placeholder="Sobrenome"
                        onChange={event => {
                            setInfoSign(prevState => {
                                return { ...prevState, 'sobrenome': event.target.value }
                            })
                        }}
                        value={infoSign.sobrenome}
                    />
                    <input
                        type="email"
                        placeholder="Email"
                        onChange={event => {
                            setInfoSign(prevState => {
                                return { ...prevState, 'email': event.target.value }
                            })
                        }}
                        value={infoSign.email}
                    />
                    <input
                        type="password"
                        placeholder="Senha"
                        onChange={event => {
                            setInfoSign(prevState => {
                                return { ...prevState, 'senha': event.target.value }
                            })
                        }}
                        value={infoSign.senha}
                    />
                    <input
                        type="password"
                        placeholder="Confirme a senha"
                        onChange={event => {
                            setInfoSign(prevState => {
                                return { ...prevState, 'senhaConfirma': event.target.value }
                            })
                        }}
                        value={infoSign.senhaConfirma}
                    />
                    <div id="div-date">
                        <label htmlFor="date">Data de nascimento:</label>
                        <input
                            type="date"
                            name="date"
                            onChange={event => {
                                setInfoSign(prevState => {
                                    return { ...prevState, 'dataNascimento': event.target.value }
                                })
                            }}
                            value={infoSign.dataNascimento}
                        />
                    </div>
                    <div id="div-checkbox">
                        <input
                            type="checkbox"
                            name="checkTerms"
                            onChange={event => {
                                setTerms(event.target.checked)
                            }}

                        />
                        <label htmlFor="checkTerms">Eu li e concordo com os <a href="#">termos de uso</a>  </label>
                    </div>

                    <Button className="button-login" placeholder="Data de nascimento" type="submit">Cadastrar</Button>
                    <p id="erroMessage"></p>
                </form>


            </main>
        </div>

    )
}
